const coinListDataUtils = {
    marketNames: (names) => {
        const data = {};

        names.forEach(name => {
            if (name.market.split("-")[0] !== "KRW")
                data[name.market] = {
                    korean: name.korean_name,
                    english: name.english_name,
                };
        });
        return data;
    },
};

export {
    coinListDataUtils
}
